DROP TABLE IF EXISTS `Competitions`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `Competitions` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `Cities_id` int(10) unsigned DEFAULT NULL,
  `code` varchar(20) NOT NULL COMMENT 'unique code given to a comp, so it can be easily identified by a name. codes will have a naming convention, for example, a competition that happened in israel in 2019 can be given the name:\n- isr2019\nso it can be easily identified by users.\n',
  `start_date` date DEFAULT NULL COMMENT 'starting date of a comp',
  `end_date` date DEFAULT NULL COMMENT 'ending date of a comp',
  `name` varchar(1027) CHARACTER SET utf8 NOT NULL COMMENT 'name if comp',
  `website` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT 'link for a website that is realted to the competition',
  `address` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT 'address of a competition. not constrained by a key so it can be very specific for local purposes. ',
  PRIMARY KEY (`id`),
  UNIQUE KEY `code_UNIQUE` (`code`),
  KEY `fk_Competitions_Cities1_idx` (`Cities_id`),
  CONSTRAINT `fk_Competitions_Cities1` FOREIGN KEY (`Cities_id`) REFERENCES `Cities` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=6672 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

